import { AiTwotoneCamera } from "react-icons/ai";
import { BsFillCameraVideoFill } from "react-icons/bs";
import { HiDocumentDuplicate } from "react-icons/hi";
import { MdOutlineAudiotrack } from "react-icons/md";
import { RecentFile } from "./RecentFile";

export const Files = () => {
  const files = [
    { name: "Work", files: 180, color: "purple", icon: AiTwotoneCamera },
    {
      name: "Personal",
      files: 20,
      color: "emerald",
      icon: HiDocumentDuplicate,
    },
    { name: "School", files: 40, color: "amber", icon: BsFillCameraVideoFill },
    { name: "Audio", files: 10, color: "blue", icon: MdOutlineAudiotrack },
  ];

  return (
    <div className="flex flex-col gap-4">
      <h1 className="font-bodyFont text-2xl font-extrabold text-sky-950">
        Recent Files
      </h1>
      <div className="flex gap-4">
        {files.map((type) => (
          <RecentFile type={type} icon={type.icon} />
        ))}
      </div>
    </div>
  );
};
